import React from 'react';

function Food({name} ) {
// function Food({fav}) {
  return <h1> i like {name} </h1>;
  // return <h1> i like {fav} </h1>
}

const foodILike = [
  {
    name : "kimchi",
    img : "1123"
  },
  {
    name : "bab",
    img : "2222"
  }

];

function App() {
  return (
      <div>
      {foodILike.map(dish => (
        <Food name={dish.name} />
      ))}
      </div>
    );
}

export default App;
